import React from 'react'

import TabelItem from "../TabelItem/TabelItem";

const PictureUP = ({list}) => {
    return (
        <div className="todo-list-container">
          {list.map((todo) => (
            <TabelItem item={todo} key={todo.id} />
          ))}
        </div>
      );
    };

export default PictureUP
